import { Grid, TextField, Button } from "@mui/material";
import React from "react";


const Form = () => {
  //Aqui deberan implementar el form completo con sus validaciones

  return (
    <div>
      <form style={{
        padd
      }}>
        <Grid container
         
          alignItems={"center"} 
          justifyContent={"space-evenly"}
          spacing={2} 
          sx={{width:"100%"}}
        >
          <Grid item
            xs={12} 
            md={12}
          >
            <TextField  
                        type="text" 
                        label="Ingrese su nombre" 
                        variant="outlined" 
                        fullWidth
                        name='nombre'                                          
                    />
          </Grid>
          <Grid item
            xs={12} 
            md={12}
          >
            <TextField  
                        type="email" 
                        label="Ingrese su email" 
                        variant="outlined" 
                        fullWidth
                        name='email'                                          
                    />
          </Grid>
          <Button type="submit" variant='contained'>Enviar Formulario</Button>
        </Grid>
      </form>
    </div>
  );
};

export default Form;
